(1, 36, 'About', 'about', '<h1>About Us</h1>\r\n<p>Welcome to \"www.reidelectronics.ml\"</p>\r\n<p>We are one of the most trusted online store in Sri Lanka for all kinds of microcontrollers related components. We offer wide range of quality products for Hobbyist, Robotic engineers, Students (to build inovative projects) &amp; all other electronic service groups. We believe in making a hassle free shoping to the versitile electronist for all kinds of electronic components.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<h1><strong>Our Policy &amp;  Service</strong></h1>\r\n<p>Offering quality products to the electronists with the best price at your door step (where ever &amp; when ever you need it).</p>\r\n<p>We focus on availing easy &amp; personlized service for out customers. Your order is processed in a minimal time with atmost care. We have tie-up with major courier suppliers (Fedex, DHL, etc.) to deliver at any part of the world.<br /><br /></p>\r\n<p> </p>\r\n<h1><strong>Contact Us</strong></h1>\r\n<p> </p>\r\n<p><strong>info@reidelectronics.ml</strong></p>\r\n<p><strong>Hot-Line : 0114126321</strong></p>\r\n<p><strong>Mobile : 0712479175</strong></p>\r\n<p><strong>Address : 56/A,Mendis Weda Road,Thalpitiya South,Wadduwa,Sri Lanka</strong></p>\r\n<p><strong>Map :</strong></p>\r\n<p><embed style=\"border: 0;\" tabindex=\"0\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d990.6814042425034!2d79.92563582920937!3d6.680874331696281!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zNsKwNDAnNTEuMSJOIDc5wrA1NSczNC4zIkU!5e0!3m2!1sen!2slk!4v1591702067432!5m2!1sen!2slk\" width=\"600\" height=\"450\"></embed></p>', '', 1, 9, '2020-06-04 14:51:09', 250, 'Joomla', '2020-06-09 11:28:13', 250, 0, '0000-00-00 00:00:00', '2020-06-04 14:51:09', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_cap