(2, 7, 1, '', '2020-06-08 10:40:53', 250, 7316, '82c708e2c2f58733ea778d15f94b6739355ea201', '{\"id\":7,\"asset_id\":\"73\",\"title\":\"main\",\"alias\":\"main\",\"introtext\":\"<div>smartslider3[1]<\\/div>\\r\\n<p><b>Text messaging<\\/b>, or\\u00a0<b>texting<\\/b>, is the act of composing and sending electronic messages, typically consisting of alphabetic and numeric characters, between two or more users of\\u00a0<a title=\\\"Mobile device\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Mobile_device\\\">mobile devices<\\/a>,\\u00a0<a title=\\\"Desktop computer\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Desktop_computer\\\">desktops<\\/a>\\/<a title=\\\"Laptop\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Laptop\\\">laptops<\\/a>, or other type of compatible computer. Text messages may be sent over a\\u00a0<a title=\\\"Cellular network\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Cellular_network\\\">cellular network<\\/a>, or may also be sent via an\\u00a0<a title=\\\"Internet\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Internet\\\">Internet<\\/a>\\u00a0connection.<\\/p>\\r\\n<p>The term originally referred to messages sent using the\\u00a0<a title=\\\"SMS\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/SMS\\\">Short Message Service<\\/a>\\u00a0(SMS). It has grown beyond alphanumeric text to include multimedia messages using the\\u00a0<a title=\\\"Multimedia Messaging Service\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Multimedia_Messaging_Service\\\">Multimedia Messaging Service<\\/a>\\u00a0(MMS) containing digital images, videos, and sound content, as well as ideograms known as\\u00a0<a title=\\\"Emoji\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Emoji\\\">emoji<\\/a>\\u00a0(<a title=\\\"Smiley\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Smiley\\\">happy faces<\\/a>, sad faces, and other icons), and\\u00a0<a class=\\\"mw-redirect\\\" title=\\\"Instant messenger\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Instant_messenger\\\">instant messenger<\\/a>\\u00a0applications (usually the term is used when on mobile devices).<\\/p>\\r\\n<p>Text messages are used for personal, family, business and social purposes. Governmental and non-governmental organizations use text messaging for communication between colleagues. In the 2010s, the sending of short informal messages has become an accepted part of many cultures, as happened earlier with\\u00a0<a title=\\\"Email\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Email\\\">emailing<\\/a>.<sup id=\\\"cite_ref-1\\\" class=\\\"reference\\\"><a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Text_messaging#cite_note-1\\\">[1]<\\/a><\\/sup>\\u00a0This makes texting a quick and easy way to communicate with friends, family and colleagues, including in contexts where a\\u00a0<a title=\\\"Telephone call\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Telephone_call\\\">call<\\/a>\\u00a0would be impolite or inappropriate (e.g., calling very late at night or when one knows the other person is busy with family or work activities). Like e-mail and\\u00a0<a title=\\\"Voicemail\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Voicemail\\\">voicemail<\\/a>\\u00a0and unlike calls (in which the caller hopes to speak directly with the recipient), texting does not require the caller and recipient to both be free at the same moment; this permits communication even between busy individuals. Text messages can also be used to interact with automated systems, for example, to order products or services from\\u00a0<a title=\\\"E-commerce\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/E-commerce\\\">e-commerce<\\/a>\\u00a0websites, or to participate in online contests. Advertisers and service providers use\\u00a0<a class=\\\"mw-redirect\\\" title=\\\"Direct Text Marketing\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Direct_Text_Marketing\\\">direct text marketing<\\/a>\\u00a0to send messages to mobile users about promotions, payment due dates, and other notifications instead of using\\u00a0<a title=\\\"Mail\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Mail\\\">postal mail<\\/a>,\\u00a0<a title=\\\"Email\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Email\\\">email<\\/a>, or\\u00a0<a title=\\\"Voicemail\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Voicemail\\\">voicemail<\\/a>.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2020-06-08 10:25:49\",\"created_by\":\"250\",\"created_by_alias\":\"\",\"modified\":\"2020-06-08 10:40:53\",\"modified_by\":\"250\",\"checked_out\":\"250\",\"checked_out_time\":\"2020-06-08 10:40:32\",\"publish_up\":\"2020-06-08 10:25:49\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\