INSERT INTO `rqjt2_virtuemart_products_en_gb` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(2, 'The Arduino Uno is an open-source microcontroller board based on the Microchip ATmega328P microcontroller and developed by Arduino.cc', '', 'Arduino UNO', '', '', '', 'arduino-uno'),
(3, 'The Arduino Nano is a small, complete, and breadboard-friendly board based on the ATmega328 (Arduino Nano 3. x).', '', 'Arduino NANO', '', '', '', 'arduino-nano'),
(4, 'The Arduino Mega 2560 is a microcontroller board based on the ATmega2560. It has 54 digital input/output pins (of which 15 can be used as PWM outputs), ', '', 'Arduino Mega', '', '', '', 'arduino-mega'),
(5, 'The Arduino Pro Mini is a microcontroller board based on the ATmega328. It has 14 digital input/output pins (of which 6 can be used as PWM outputs), 6 analog inputs, an on-board resonator, a reset button, and holes for mounting pin headers.', '', 'Arduino Pro Mini', '', '', '', 'arduino-pro-mini'),
(6, 'The Arduino Leonardo is a microcontroller board based on the ATmega32u4 (datasheet). It has 20 digital input/output pins (of which 7 can be used as PWM outputs and 12 as analog inputs), a 16 MHz crystal oscillator, a micro USB connection, a power jack, an ICSP header, and a reset button.', '', 'Arduino Leonardo', '', '', '', 'arduino-leonardo'),
(7, 'Raspberry Pi 4 Desktop kit is supplied with:\r\n\r\nRaspberry Pi 4 Model B (2GB, 4GB or 8GB version)\r\nRaspberry Pi Keyboard & Mouse\r\n2 × micro HDMI to Standard HDMI (A/M) 1m Cables\r\nRaspberry Pi 15.3W USB-C Power Supply\r\nRaspberry Pi 4 Case\r\nOfficial Raspberry Pi Beginner\'s Guide (English language)\r\n16GB NOOBS with Raspberry Pi OS microSD card', '', 'Raspberry Pi 4 Desktop Kit', '', '', '', 'raspberry-pi-4-desktop-kit'),
(8, 'Raspberry Pi 4 Model B was released in June 2019[ with a 1.5 GHz 64-bit quad core ARM Cortex-A72 processor, on-board 802.11ac Wi-Fi, Bluetooth 5, full gigabit Ethernet (throughput not limited), two USB 2.0 ports, two USB 3.0 ports, and dual-monitor support via a pair of micro HDMI (HDMI Type D) ports for up to 4K resolution . The Pi 4 is also powered via a USB-C port, enabling additional power to be provided to downstream peripherals, when used with an appropriate PSU. The initial Raspberry Pi 4 board has a design flaw where third-party e-marked USB cables, such as those used on Apple MacBooks, incorrectly identify it and refuse to provide power.Tom\'s Hardware tested 14 different cables and found that 11 of them turned on and powered the Pi without issue. The design flaw was fixed in revision 1.2 of the board, released in late 2019.', '', 'Raspberry Pi 4', '', '', '', 'raspberry-pi-4'),
(9, 'You\'ll need (not included)\r\n\r\nMicro SD card with NOOBS\r\nMicro USB power supply (2.1 A)\r\nAnd to use it as a desktop computer, you\'ll need:\r\n\r\nTV or monitor and HDMI cable\r\nKeyboard and mouse', '', 'Raspberry Pi 3 Model B', '', '', '', 'raspberry-pi-3-model-b'),
(10, '12.3 megapixel Sony IMX477 sensor, 7.9mm diagonal image size, and back-illuminated sensor architecture, with adjustable back focus and support for C- and CS-mount lenses', '', 'Raspberry Pi High Quality Camera', '', '', '', 'raspberry-pi-high-quality-camera'),
(11, 'The official Raspberry Pi keyboard includes three USB ports for connecting external devices, available in raspberry red and white, or black and grey', '', 'Raspberry Pi keyboard and hub', '', '', '', 'raspberry-pi-keyboard-and-hub'),
(12, 'The official Raspberry Pi mouse, available in raspberry red and white, or black and grey', '', 'Raspberry Pi mouse', '', '', '', 'raspberry-pi-mouse'),
(13, 'The official and recommended universal micro USB power supply for Raspberry Pi. We’ve tested this supply in all kinds of situations, and it’s as solid as a rock; it’ll keep feeding your Pi the steady 2.5A it needs for proper performance.\r\n\r\n1.5m lead\r\nInterchangeable heads for different countries\r\nShort circuit, over current and over voltage protection\r\n50,000 hours MTBF\r\n1 year warranty', '', 'Raspberry Pi Universal Power Supply', '', '', '', 'raspberry-pi-universal-power-supply'),
(14, 'This add-on board lets you receive digital DVB-T2 TV streams on your Raspberry Pi to view them or stream them over a network to other devices', '', 'Raspberry Pi TV HAT', '', '', '', 'raspberry-pi-tv-hat'),
(15, 'The Raspberry Pi PoE HAT powers a Raspberry Pi 4 Model B and Raspberry Pi 3 Model B+ via an Ethernet cable. Power-sourcing equipment is required on the Ethernet network.', '', 'Raspberry PoE HAT', '', '', '', 'raspberry-pi-tv-hat-1'),
(16, 'The HC-SR04 ultrasonic sensor uses sonar to determine distance to an object like bats do. It offers excellent non-contact range detection with high accuracy and stable readings in an easy-to-use package.', '', ' HC-SR04 Ultrasonic Module', '', '', '', 'hc-sr04-ultrasonic-module'),
(17, 'This module is very easy to use and is often used in robots to detect objects near the sensor. These sensors have a digital output pin that outputs a signal when it detects an object. When the module detects an obstacle, the green indicator light on the board lights up. The module detects the distance 2 ~ 30cm, detection angle 35 °.', '', 'IR Infrared Obstacle Avoidance Sensor Module', '', '', '', 'ir-infrared-obstacle-avoidance-sensor-module'),
(18, 'This is a simple water sensor that can be used to detect soil moisture. It outputs a high signal when the moisture is above a certain threshold. You can also read an analog signal whose value is proportional to the moisture level. Use this sensor to create an automatic self-watering plant. Here’s the complete guide on how to use the hygrometer module with your Arduino.', '', ' Soil Hygrometer Detection Module Soil Moisture Sensor', '', '', '', 'soil-hygrometer-detection-module-soil-moisture-sensor'),
(19, 'This sensor is used for sound detection. This module has two outputs: AO (analog output), or DO (digital output). The digital output sends a high signal when the sound the sound intensity reaches a certain threshold. The threshold-sensitivity can be adjusted via potentiometer on the sensor.', '', 'Microphone Sensor', '', '', '', 'microphone-sensor'),
(20, 'You can use this module to measure the absolute pressure of the environment. By converting the pressure measures into altitude, you have a reliable sensor for determining the height of your robot or projectile, for example. This sensor also measures temperature and humidity.', '', 'Digital Barometric Pressure Sensor Board', '', '', '', 'digital-barometric-pressure-sensor-board'),
(21, 'You can use this module for light detection with an Arduino.', '', ' Photoresistor Sensor Module Light Detection Light', '', '', '', 'photoresistor-sensor-module-light-detection-light'),
(22, 'The module uses an NTC thermistor to measure temperature and provides both analog and digital outputs. Thermistors are essentially resistors whose resistance value changes with changes in temperature.', '', 'Digital Thermal Sensor Module Temperature Sensor Module', '', '', '', 'digital-thermal-sensor-module-temperature-sensor-module'),
(23, 'When you rotate the rotary encoder it counts in the positive direction and the reverse direction. Rotation counts are not limited. With the buttons on the rotary encoder, you can reset to its initial state and start counting from 0.', '', 'Rotary Encoder Module Brick Sensor Development Board', '', '', '', 'rotary-encoder-module-brick-sensor-development-board'),
(24, 'The MQ-2 Gas Sensor module is useful for gas leakage detecting in home and industry. It can detect LPG, i-butane, propane, methane ,alcohol, hydrogen and smoke. The module have a built-in variable resistor to adjust the sensitivity of the sensor.', '', 'MQ-2Gas Sensor Module Smoke Methane Butane Detection', '', '', '', 'mq-2gas-sensor-module-smoke-methane-butane-detection'),
(25, 'This module can be used to trigger the effect of various vibration, theft alarm, intelligent car, earthquake alarm, motorcycle alarm, etc.', '', 'SW-420 Motion Sensor Module Vibration Switch Alarm', '', '', '', 'sw-420-motion-sensor-module-vibration-switch-alarm'),
(26, 'This is a rain sensor. It’s used for all kinds of weather monitoring. Here’s the complete guide on how to use the rain sensor module with the Arduino.', '', 'Humidity and Rain Detection Sensor Module', '', '', '', 'humidity-and-rain-detection-sensor-module'),
(27, 'A simple sound making module. You set high or low to drive this module. By changing the frequency you’ll hear a different sound', '', 'Passive Buzzer Module', '', '', '', 'passive-buzzer-module'),
(28, 'Designed with slotted optical switch sensor, indicator light. Working with official MCU board.Widely used in motor speed detection, pulse counter, etc .', '', 'Speed Sensor Module', '', '', '', 'speed-sensor-module'),
(29, 'Flame detection sensor module is sensitive to the flame, but also can detect ordinary light. This is usually used as a flame alarm. Detects a flame or a light source of a wavelength in the range of 760nm to 1100 nm. Detection point of about 60 degrees, particularly sensitive to the flame spectrum.', '', 'IR Infrared Flame Detection Sensor Module', '', '', '', 'ir-infrared-flame-detection-sensor-module'),
(30, 'This is a 2 Channel 5V Relay Module. It allows you to control various appliances that operate at high voltages, with low voltages like 5V. It can be controlled directly by any microcontroller.', '', '5V 2-Channel Relay Module', '', '', '', '5v-2-channel-relay-module'),
(31, 'A simple module to power your breadboard. It supplies both 3.3V and 5V. This is specially useful to power up your breadboard circuits from an external power supply.', '', 'Breadboard Power Supply Module 3.3V 5V', '', '', '', 'breadboard-power-supply-module-3-3v-5v'),
(32, 'A simple module to power your breadboard. It supplies both 3.3V and 5V. This is specially useful to power up your breadboard circuits from an external power supply.', '', 'Breadboard Power Supply Module 3.3V 5V', '', '', '', 'breadboard-power-supply-module-3-3v-5v-1'),
(33, 'A PIR sensor is a little module that allows you to detect movement from humans or pets. It’s easy to integrate with your microcontroller.', '', 'HC-SR501 Pyroelectric Infrared Sensor Module', '', '', '', 'hc-sr501-pyroelectric-infrared-sensor-module'),
(34, 'ADXL335 Accelerometer Module. The ADXL335 is a small, low power, complete 3-axis accelerometer with signal conditioned voltage outputs. It can measure the static acceleration of gravity in tilt-sensing applications, as well as dynamic acceleration resulting from motion, shock, or vibration', '', 'Accelerometer Module', '', '', '', 'accelerometer-module'),
(35, 'If you need data sent from one microcontroller to another, the 433MHz link modules are a cheap way to do that (all data is sent via Radio Frequency). ', '', 'RF 433MHz Transmitter+Receiver', '', '', '', 'rf-433mhz-transmitter-receiver'),
(36, 'This module costs a little bit more than $2, but it’s totally worth it. You can get one ESP8266 WiFi Module for about $4 on eBay. This module can send emails, host a web server, control LEDs, etc.', '', 'ESP8266 WiFi Module', '', '', '', 'esp8266-wifi-module'),
(37, 'Learn computer coding with Scratch, Microsoft MakeCode, Python, Swift Playgrounds and other programming languages\r\nBuilt-in features make it easy to get started: 25 LEDs, 2 buttons, motion sensor, light sensor, temperature sensor, compass, radio and Bluetooth wireless\r\nEdge connector enables expansion for robotics, electronics, gaming and more (accessories sold separately)\r\nFree tutorials and project ideas available on the micro:bit website\r\nBox contains: 1 micro:bit (no USB cable, no battery holder)', '', 'Micro : Bit', '', '', '', 'micro-bit'),
(38, 'Robot toy car is a collection of BBC micro:bit board, learning kits, and expansion boards, allowing you to learn micro:bit from simplest to more complex,turn ideas into reality and let more children become maker. The vehicle model is small and cute. Most of the parts are connected with screw and a few parts are designed with anti reverse socket, which makes installation simple and safe.\r\nMulti-function expansion board with vertical slot structure as chassis of the vehicle, it is equipped with RGB lights, sensors, buzzers, various module interfaces and so on, besides, it can drive 2 DC motors and 3 servos simultaneously.\r\nIt can be controlled by IR remote control, and APP remote control by Android and iOS.It supports multiple functions: tracking, ultrasonic obstacle avoidance, following, light discoloration, singing, playing music, etc. Handle control (please order the handle separately: B07YYFDYW5, the handle also needs a separate micro:bit)\r\n★Note 1: Children without programming foundation need parental support ★ Note 2: You need to prepare micro: bit for yourself. Without micro: bit, the robot can\'t work properly.If you need to order the micro: bit version, please search ASIN: B083DR8GGR. ★Note 3:The robot kit is not assembled,you need to install it yourself.\r\nIt supports JavaScript graphical programming, Python and other micro:bit programming methods.More than 30 kinds of experiment courses are provided.Please contact us by email amazon@yahboom.com,we will solve all the doubts about the product for you.', '', 'Yahboom BBC Micro:bit Coding Robot', '', '', '', 'yahboom-bbc-micro-bit-coding-robot'),
(39, 'Powerful functions -> Obstacle avoidance, light-tracing, line-tracking, remote control, playing melody, colorful lights. Overview video -> https://youtu.be/rs5gc8_rKLU\r\nDetailed tutorial with rich projects -> From making sound, lighting up the LED, to controlling the car to work in different modes. Download link: https://git.io/fjyq6\r\nBlocks and Python code -> Contains the easiest to use Blocks and the most popular Python code.\r\nReady for play -> No complicated installation and wiring. (A 3.7V 18650 rechargeable battery is needed)\r\nRemote control -> Use your Android device or another micro:bit (an extra micro:bit is needed).', '', 'Freenove Micro:Rover Kit for BBC Micro:bit', '', '', '', 'freenove-micro-rover-kit-for-bbc-micro-bit'),
(40, 'Detailed tutorial and complete code. Download link -> https://git.io/fjyL8\r\n2 working modes -> This car can works in video car mode and radar car mode.\r\nAndroid APP -> Using your Android device to control this car. (Run Android 4.4 or later)\r\nCompatible models -> Raspberry Pi 4B / 3B+ / 3B / 2B / 1B+. (NOT included in this kit)\r\nPackage -> Contains all the parts needed. (Batteries and charger are required, please see tutorial)', '', 'Freenove Three-Wheeled Smart Car Kit', '', '', '', 'freenove-three-wheeled-smart-car-kit'),
(41, 'This is a robot that can crawl and twist like a creature. Overview video -> https://youtu.be/LXd9Vaw5pFc\r\nProvide detailed step-by-step assembly tutorial and complete code. Download link -> https://git.io/fjDQR\r\nCan be controlled wirelessly by remote control (contained in this kit), computers and Android devices.\r\nProvide code library for you to reprogram the robot and free ports to connect other modules or circuits.\r\nContains all the parts needed to assemble the robot. (Batteries and charger are required, please see tutorial)', '', 'Freenove Hexapod Robot Kit with Remote Control', '', '', '', 'freenove-hexapod-robot-kit-with-remote-control'),
(42, 'Damping Effect - Shock absorber spring achieve damping effect. Widely suit for road surface\r\nAluminum Alloy Car Platform - offer outstanding appearance, higher durability and stability\r\nDual DC 9V Motor is equipped with a speed feedback circuit and Hall speed. Dual motor offers higher power and speed. NOTE: Battery is not contained\r\nFlexibility - go forward, go backward, turn left, turn right, turn around\r\nEasy to assembled by yourself and easy to learn Arduino Raspberry Pi DIY.', '', 'Tracked Robot Smart Car Platform', '', '', '', 'tracked-robot-smart-car-platform'),
(43, 'Smart 4WD robot car chassis with 4 TT DC Gear Motor, horsepower fullness, Operating voltage: 3V - 12V.\r\nDC Motor Reduction Ratio: 1:48 (3V Motor No-load speed 125RPM).\r\nRobot chassis kit made of PCB material, Size:256*150*2MM, Maximum Load 500g.\r\nWith many circuit mounting holes, users can add some micro-controller (such as Arduino/Raspberry Pi) and sensor modules to realize function of tracing, obstacle avoidance, distance testing, speed testing, wireless remote control.\r\nThis 4WD robot car chassis convenient installation, firm and reliable.', '', '4WD Robot Chassis Kit', '', '', '', '4wd-robot-chassis-kit'),
(44, 'Learn computer coding with Scratch, Microsoft MakeCode, Python, Swift Playgrounds and other programming languages\r\nBuilt-in features make it easy to get started: 25 LEDs, 2 buttons, motion sensor, light sensor, temperature sensor, compass, radio and Bluetooth wireless\r\nEdge connector enables expansion for robotics, electronics, gaming and more (accessories sold separately)\r\nFree tutorials and project ideas available on the micro:bit website\r\nBox contains: 10 micro:bits, 10 USB cables, 10 battery holders, 20 AAA batteries', '', 'micro:bit Club 10 Pack', '', '', '', 'micro-bit-club-10-pack'),
(45, 'Learn computer coding with Scratch, Microsoft MakeCode, Python, Swift Playgrounds and other programming languages\r\nBuilt-in features make it easy to get started: 25 LEDs, 2 buttons, motion sensor, light sensor, temperature sensor, compass, radio and Bluetooth wireless\r\nEdge connector enables expansion for robotics, electronics, gaming and more (accessories sold separately)\r\nFree tutorials and project ideas available on the micro:bit website\r\nBox contains: 1 micro:bit (no USB cable, no battery holder)', '', 'micro:bit, Pocket-Sized, programmable Computer', '', '', '', 'micro-bit,-pocket-sized,-programmable-computer');

