INSERT INTO `rqjt2_virtuemart_shipmentmethods_en_gb` (`virtuemart_shipmentmethod_id`, `shipment_name`, `shipment_desc`, `slug`) VALUES
(1, 'First-Class Mail', 'This is the Postal Service’s best-known service, and a good option if your item fits into an envelope or small package. It also provides the benefit of shipping directly from your mailbox, without necessitating a trip to the post office—assuming that you can figure out the correct postage in advance, that is. Delivery is typically three days or less.', 'first-class-mail'),
(2, 'Priority Mail', 'This is the preferred shipping method for many experienced auction sellers, as it offers a good trade-off between delivery speed (2-3 days) and cost. There’s also the advantage of getting a flat rate on small packages shipped in one of their flat-rate boxes or envelopes; this makes it easier to calculate shipping charges upfront—it doesn’t matter where the buyer lives, the price is the same. (Those boxes and envelopes are also free, which can save you lots of money.)', 'priority-mail'),
(3, 'Parcel Post', 'This used to be known as the “slow” USPS service for larger packages, but it has gotten faster of late—and it’s priced lower than Priority Mail. Still, shipping something Parcel Post from coast to coast might take seven to nine days, as opposed to Priority Mail’s two or three days.', 'parcel-post');

